	public static void countMoney(File[] files) {
		long totalMoney = 0;
		long totalCount = 0;
		try {
			for (int i = 0; i < files.length; i++) {
				// 判断此文件是否是一个文件
				if (!files[i].isDirectory()) {
					System.out.println("文件名:" + files[i].getName());
					String fileName = files[i].getName();// 文件名
					// 文件路径
					String filePath = FILES_PATH + fileName;
					// 读取文件
					BufferedReader br = new BufferedReader(new FileReader(filePath));
					String temp;
					do {
						// 按行循环读取文件
						temp = br.readLine();
						if (null != temp) {
							if (temp.contains("moneyAll")) {
								totalCount++;
								String x = temp.substring(temp.indexOf("moneyAll"));
								String y = x.substring(x.indexOf("=") + 1, x.indexOf("&"));
								String money[] = y.split("%2C");
								for (String string : money) {
									System.out.println(string);
									try {
										totalMoney += Integer.parseInt(string);
									} catch (NumberFormatException e) {
										e.printStackTrace();
										System.out.println("temp="+temp);
									}
								}
							}
						}
						// 把读取到的行存入数组变量
					} while (temp != null);
					br.close();
				}
			}
			System.out.println("totalCount注单笔数:" + totalCount + ",totalMoney总下注金额:" + totalMoney);
		} catch (FileNotFoundException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

	public static void countVisitors(File[] files) {
		try {
			Map<String, String> users = new ConcurrentHashMap<String, String>();
			for (int i = 0; i < files.length; i++) {
				// 判断此文件是否是一个文件
				if (!files[i].isDirectory()) {
					System.out.println("文件名:" + files[i].getName());
					String fileName = files[i].getName();// 文件名
					// 文件路径
					String filePath = FILES_PATH + fileName;
					// 读取文件
					BufferedReader br = new BufferedReader(new FileReader(filePath));
					String temp;
					do {
						// 按行循环读取文件
						temp = br.readLine();
						if (null != temp) {
							if (temp.contains("用户")) {
								String x = temp.substring(temp.indexOf("用户"));
								Matcher matcher = Pattern.compile("\\[.*?\\]").matcher(x);
								while (matcher.find()) {
									if (matcher.start() == 2) {
										String original = matcher.group(0); // [张三]
										original = original.substring(1, original.length() - 1);
										if (!users.containsKey(original)) {
											users.put(original, "");
										}
									}
								}

							}
						}
						// 把读取到的行存入数组变量
					} while (temp != null);
					br.close();
				}
			}
			System.out.println("访问人数:" + users.size());
		} catch (FileNotFoundException e) {
			e.printStackTrace();
		} catch (IOException e) {
			e.printStackTrace();
		}
	}
